      "excerpt": "<h1 id=\"防抖与节流函数\"><a class=\"header-anchor\" href=\"#防抖与节流函数\">#</a> 防抖与节流函数</h1>\n<p>防抖和节流的作用都是在高频事件中防止函数被多次调用，是一种性能优化的方案。</p>\n<p>区别在于，防抖函数只会在高频事件结束后n毫秒调用一次函数，节流函数会在高频事件触发过程当中每隔n毫秒调用一次函数。</p>\n",
